Alaska DHSS COVID-19: Situation Overview
Alaska DHSS survey explores how COVID-19 pandemic is impacting Alaska families:
Programs in the Division of Public Health are seeking the public's input in understanding the challenges Alaskans are facing through the ongoing pandemic. The responses will be used to improve programs serving Alaska families.
The Maternal Child Health Epidemiology Unit in the Section of Women's, Children's and Family Health is coordinating the survey. The first survey will be open for several weeks, and initial results will be summarized and shared by the unit before the end of April. The unit is asking Alaskans to sign up to receive additional short follow-up surveys on focused topics, including the impact on education, physical and mental health of children in Alaska.
